🥰😊😍☺️

This boy.❤️
I couldn’t be more grateful for a child.
In between Esthers birth and his own were many many MANY back to back miscarriages.
I had miscarried once before Esther’s brith & and then four more times before Ezekiel’s birth.

So- with all of that said, I cherish these sweet smiles with my whole heart. These sweet moments are everything to me.❤️

